// Available variables and functions:
// input: input data
// config: module config
// setConfig: function to set the config of the module
// setOutput: function to set the output of the module

import {useEffect} from 'react';
import {Accordion,AccordionDetails,AccordionSummary,Box,Typography} from '@mui/material';
import * as Icon from '@mui/icons-material'

const {input,config,setConfig,setOutput} = props

export default function DataViewer(){
    // DataViewer only inspects top 10 datapoints
    useEffect(() => {
        if (!(input && input.input)) return;
        setOutput({output:input.input})
    }, [input]);

    if (input && input.input){
        if (typeof input.input === 'object' && Object.keys(input).length > 0){
            return (
                <>
                {Object.entries(input.input).slice(0,10).map(([key, value]) => {
                    return (
                        <Accordion key={key} variant='outlined' sx={{p:1,m:0}} disableGutters>
                            <AccordionSummary
                                expandIcon={<Icon.ExpandMore />}
                                sx ={{ width:"100%",height:10, m:0, p:0,paddingLeft:1, minHeight:10, borderRadius:0}}
                            >
                                <Typography variant='caption'>{key}</Typography>
                            </AccordionSummary>
                            <AccordionDetails sx={{ width:"100%",height:200,overflow:"auto"}}>
                                <Typography variant='caption' sx={{fontSize:10,whiteSpace: 'pre-wrap',wordBreak: 'break-word'}}>
                                    {JSON.stringify(value, null, 2)}
                                </Typography>
                            </AccordionDetails>
                        </Accordion>
                    );
                })
                }
                </>
            )
        } else {
            return (
            <Box sx={{height:"100%",width:"100%"}}>
                <Typography sx={{fontSize:10,whiteSpace: 'pre-wrap',wordBreak: 'break-word'}}>
                    {Object.keys(input).length > 0 ? JSON.stringify(input, null, 2) : ''}
                </Typography>
            </Box>)
        }
    }
}

import { TextField} from "@mui/material";
import { useEffect,useState} from "react";

const {input,config,setConfig,setOutput} = props

export default function TextInput(){
    const [value,setValue]=useState(config.value||"")
    const handleChange = (e) => {
        setValue(e.target.value);
    }
    const handleCommit = (e)=> {
        setConfig({...config,value:value});
        setOutput({output:value})
    }

    // useEffect(()=>{
    //     if (!value) return;
    //     setOutput({output:value});
    //     setConfig({...config, value:value});
    // },[value]);

    return (
        <TextField type="text"
            value={value}
            onChange={handleChange}
            onMouseLeave = {handleCommit}
            sx={{width: "100%", height: "100%", padding: "5px"}}
            placeholder="Type something here"
            size="small"
            multiline
            rows={5}
            InputProps={{style: { fontSize: 10}}}
        />
    );
}
